import React from "react";
import ReactDOM from "react-dom";
import Home from "./Home";

class App extends React.Component {
  render() {
    return (
      <div>
        <Home />
        <Banner />
      </div>
    );
  }
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
